    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-12-20T20:34:45.080693",nt"name": "ghrsst-level-2p-gridded-global-subskin-sea-surface-temperature-from-the-advanced-scanning-micro",nt"isopen":
    false,nt"url": null,nt"notes": "The Advanced Microwave Scanning Radiometer
    (AMSR-E) was launched on 4 May 2002, aboard NASA's Aqua spacecraft. The National
    Space Development Agency of Japan (NASDA) provided AMSR-E to NASA as an indispensable
    part of Aqua's global hydrology mission. Over the oceans, AMSR-E is measuring a
    number of important geophysical parameters, including sea-surface temperature (SST),
    wind speed, atmospheric water vapor, cloud water, and rain rate. A key feature of
    AMSR-E is its capability to see through clouds, thereby providing an uninterrupted
    view of global SST and surface wind fields. Remote Sensing Systems (RSS, or REMSS)
    is the provider of these SST data for the Group for High Resolution Sea Surface
    Temperature (GHRSST) Project. Although the product designation is "L2P_GRIDDED"
    it is in actuality a Level 3 Collated (L3C) product as defined in the GHRSST Data
    Processing Specification (GDS) version 2.0. Its "L2P_GRIDDED" name derives from
    a deprecated specification in the early Pilot Project phase of GHRSST (pre 2008)
    and has remained for file naming continuity. In this dataset, both ascending (daytime)
    and descending (daytime) gridded orbital passes on packaged into the same daily
    file.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
